import { Grid } from "@mui/material";
import Twist from "./Twist";
const ListTwist = ({ twists }) => {
  return (
    <Grid container>
      {twists.map((item, index) => {
        return <Twist content={item} key={index}></Twist>;
      })}
    </Grid>
  );
};

export default ListTwist;
